import React from 'react';
import { useEffect } from 'react';
import youtubeApi from '../api/index/youtubeApi'
import SearchBar from '../components/SearchBar';

const Main = (props) => {
    useEffect(() => {
        youtubeApi.getVideoList()
        .then(response => console.log(response))
    })
    return(
        <>
            <SearchBar></SearchBar>
        </>
    );}

export default Main;
